import React from "react";

import { ButtonPropsType } from "./types";

const Button: React.FC<ButtonPropsType> = ({ label, onClick, type }) => (
  <button onClick={onClick ? onClick : () => {}} type={type || "button"}>
    {label}
  </button>
);

export default Button;
